CREATE TABLE SEGURO_DW_G26473471.DIM_CLIENTE(
    SK_DIM_CLIENTE INTEGER,
    COD_CLIENTE INTEGER,
    NB_CLIENTE VARCHAR(25),
    CI_RIF VARCHAR(45),
    TELEFONO VARCHAR(45),
    DIRECCION VARCHAR(45),
