    CONSTRAINT PK_DIM_EVALUACION_SERVICIO PRIMARY KEY (SK_DIM_EVALUACION_SERVICIO)
);

CREATE TABLE SEGURO_DW_G26473471.DIM_CONTRATO(
    SK_DIM_CONTRATO INTEGER,
    NRO_CONTRATO INTEGER,
    DESCRIP_CONTRATO VARCHAR(25),
