    COD_PAIS VARCHAR(45),
    NB_PAIS VARCHAR(45),
    CONSTRAINT PK_DIM_SUCURSAL PRIMARY KEY (SK_DIM_SUCURSAL)
);
--HECHOS

CREATE TABLE SEGURO_DW_G26473471.FACT_METAS(
    SK_DIM_FECHA_INICIO_META INTEGER,
    SK_DIM_PRODUCTO INTEGER,
    SK_DIM_FECHA_FIN_META INTEGER,
    MONTO_META_VENTA REAL,
    META_RENOVACION INTEGER,
    META_ASEGURADOS INTEGER,
    CONSTRAINT PK_FACT_METAS PRIMARY KEY (SK_DIM_FECHA_INICIO_META,SK_DIM_PRODUCTO,SK_DIM_FECHA_FIN_META),
    CONSTRAINT FK_DIM_FECHA_INICIO_META FOREIGN KEY (SK_DIM_FECHA_INICIO_META) REFERENCES SEGURO_DW_G26473471.DIM_TIEMPO (SK_DIM_TIEMPO),
    CONSTRAINT FK_DIM_FECHA_FIN_META FOREIGN KEY (SK_DIM_FECHA_FIN_META) REFERENCES SEGURO_DW_G26473471.DIM_TIEMPO (SK_DIM_TIEMPO),
    CONSTRAINT FK_DIM_PRODUCTO FOREIGN KEY (SK_DIM_PRODUCTO) REFERENCES SEGURO_DW_G26473471.DIM_PRODUCTO (SK_DIM_PRODUCTO)
);

CREATE TABLE SEGURO_DW_G26473471.FACT_EVALUACION_SERVICIO(
    SK_DIM_FECHA_RECOMIENDA INTEGER,
    SK_DIM_CLIENTE INTEGER,
    SK_DIM_PRODUCTO INTEGER,
    SK_DIM_EVALUACION_SERVICIO INTEGER,
    CANTIDAD INTEGER,
    RECOMIENDA_AMIGO INTEGER,
    CONSTRAINT PK_FACT_EVALUACION_SERVICIO PRIMARY KEY (SK_DIM_FECHA_RECOMIENDA,SK_DIM_CLIENTE,SK_DIM_PRODUCTO,SK_DIM_EVALUACION_SERVICIO),
    CONSTRAINT FK_DIM_FECHA_RECOMIENDA FOREIGN KEY (SK_DIM_FECHA_RECOMIENDA) REFERENCES SEGURO_DW_G26473471.DIM_TIEMPO (SK_DIM_TIEMPO),
    CONSTRAINT FK_DIM_CLIENTE FOREIGN KEY (SK_DIM_CLIENTE) REFERENCES SEGURO_DW_G26473471.DIM_CLIENTE (SK_DIM_CLIENTE),
    CONSTRAINT FK_DIM_PRODUCTO FOREIGN KEY (SK_DIM_PRODUCTO) REFERENCES SEGURO_DW_G26473471.DIM_PRODUCTO (SK_DIM_PRODUCTO),
    CONSTRAINT FK_DIM_EVALUACION_SERVICIO FOREIGN KEY (SK_DIM_EVALUACION_SERVICIO) REFERENCES SEGURO_DW_G26473471.DIM_EVALUACION_SERVICIO(SK_DIM_EVALUACION_SERVICIO)
);

CREATE TABLE SEGURO_DW_G26473471.FACT_REGISTRO_CONTRATO(
    SK_DIM_TIEMPO_FECHA_INICIO INTEGER,
    SK_DIM_TIEMPO_FECHA_FIN INTEGER,
    SK_DIM_CLIENTE INTEGER,
