    CONSTRAINT FK_DIM_TIEMPO_FECHA_INICIO FOREIGN KEY (SK_DIM_TIEMPO_FECHA_INICIO) REFERENCES SEGURO_DW_G26473471.DIM_TIEMPO (SK_DIM_TIEMPO),
    CONSTRAINT FK_DIM_TIEMPO_FECHA_FIN FOREIGN KEY (SK_DIM_TIEMPO_FECHA_FIN) REFERENCES SEGURO_DW_G26473471.DIM_TIEMPO (SK_DIM_TIEMPO),
    CONSTRAINT FK_DIM_CLIENTE FOREIGN KEY (SK_DIM_CLIENTE) REFERENCES SEGURO_DW_G26473471.DIM_CLIENTE (SK_DIM_CLIENTE),
    CONSTRAINT FK_DIM_PRODUCTO FOREIGN KEY (SK_DIM_PRODUCTO) REFERENCES SEGURO_DW_G26473471.DIM_PRODUCTO (SK_DIM_PRODUCTO),
    CONSTRAINT FK_DIM_ESTADO_CONTRATO FOREIGN KEY (SK_DIM_ESTADO_CONTRATO) REFERENCES SEGURO_DW_G26473471.DIM_ESTADO_CONTRATO (SK_DIM_ESTADO_CONTRATO)
);

CREATE TABLE SEGURO_DW_G26473471.FACT_REGISTRO_SINIESTRO(
    SK_DIM_FECHA_SINIESTRO INTEGER,
    SK_DIM_FECHA_RESPUESTA INTEGER,
    SK_DIM_CLIENTE INTEGER,
    SK_DIM_SUCURSAL INTEGER,
    SK_DIM_CONTRATO INTEGER,
    SK_DIM_PRODUCTO INTEGER,
    SK_DIM_SINIESTRO INTEGER,
    CANTIDAD INTEGER,
    MONTO_RECONOCIDO REAL,
    MONTO_SOLICITADO REAL,
    ID_RECHAZO CHAR(2),
    CONSTRAINT PK_FACT_REGISTRO_SINIESTRO PRIMARY KEY (SK_DIM_FECHA_SINIESTRO, SK_DIM_FECHA_RESPUESTA, SK_DIM_CLIENTE, SK_DIM_SUCURSAL, SK_DIM_CONTRATO, SK_DIM_PRODUCTO, SK_DIM_SINIESTRO),
    CONSTRAINT FK_DIM_FECHA_SINIESTRO FOREIGN KEY (SK_DIM_FECHA_SINIESTRO) REFERENCES SEGURO_DW_G26473471.DIM_TIEMPO (SK_DIM_TIEMPO),
    CONSTRAINT FK_DIM_FECHA_RESPUESTA FOREIGN KEY (SK_DIM_FECHA_RESPUESTA) REFERENCES SEGURO_DW_G26473471.DIM_TIEMPO (SK_DIM_TIEMPO),
    CONSTRAINT FK_DIM_CLIENTE FOREIGN KEY (SK_DIM_CLIENTE) REFERENCES SEGURO_DW_G26473471.DIM_CLIENTE (SK_DIM_CLIENTE),
    CONSTRAINT FK_DIM_SUCURSAL FOREIGN KEY (SK_DIM_SUCURSAL) REFERENCES SEGURO_DW_G26473471.DIM_SUCURSAL (SK_DIM_SUCURSAL),
    CONSTRAINT FK_DIM_CONTRATO FOREIGN KEY (SK_DIM_CONTRATO) REFERENCES SEGURO_DW_G26473471.DIM_CONTRATO (SK_DIM_CONTRATO),
    CONSTRAINT FK_DIM_PRODUCTO FOREIGN KEY (SK_DIM_PRODUCTO) REFERENCES SEGURO_DW_G26473471.DIM_PRODUCTO (SK_DIM_PRODUCTO),
    CONSTRAINT FK_DIM_SINIESTRO FOREIGN KEY (SK_DIM_SINIESTRO) REFERENCES SEGURO_DW_G26473471.DIM_SINIESTRO (SK_DIM_SINIESTRO)
);

-- -----------------------------------------------  FIN MODELO DIMENSIONAL -----------------------------------------------

-- -----------------------------------------------  CREACION DE USUARIO PARA CONECTAR CON PENTAHO Y POWERBI -----------------------------------------------

DROP USER IF EXISTS user_prueba;
CREATE USER user_prueba WITH PASSWORD '1234';

DO $$
DECLARE
	existe INTEGER;
BEGIN
	SELECT count(*) INTO existe FROM pg_roles WHERE rolname = 'readwrite'; 
	IF existe=1 THEN
		REVOKE ALL ON DATABASE proyecto_bi FROM readwrite;
	END IF;
END $$;	

DROP ROLE IF EXISTS readwrite;
CREATE ROLE readwrite;

GRANT CONNECT ON DATABASE proyecto_bi TO readwrite;
GRANT USAGE, CREATE ON SCHEMA SEGURO_G26473471,SEGURO_DW_G26473471 TO readwrite;
GRANT SELECT, INSERT, UPDATE, DELETE ON ALL TABLES IN SCHEMA SEGURO_G26473471,SEGURO_DW_G26473471 TO readwrite;
GRANT readwrite TO user_prueba;


